import React from "react";
import { Form, FormGroup, Row, Col, Container } from 'reactstrap';
import { FormControl, InputLabel, Select, MenuItem } from "@material-ui/core";
import MenuSuperior from "../menuSuperior/MenuSuperior";
import Box from '@material-ui/core/Box';
import { Button } from "@material-ui/core";
import Table, {classes}from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import StyledTableCell from '@material-ui/StyledTableCell'

const checkpromo = (props) => {
    return (
        <div>
            <MenuSuperior />
            <Container>
                <Form >
                    <Row>
                        <Col sm={4} md={6} xl={6} lg={6}>
                            <FormGroup>
                                <FormControl>
                                    <InputLabel id="select-label"></InputLabel>
                                    <Select
                                        labelId="select-label"
                                        id="select"
                                    >
                                        <MenuItem selected disabled value="">Selecione Opção</MenuItem>
                                        <MenuItem value=""></MenuItem>
                                    </Select>
                                </FormControl>
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <Col sm={4} md={6} xl={6} lg={6}>
                            <Button color="primary">Filtrar</Button>{' '}
                        </Col>
                    </Row>
                    <Row>
                        <Col>
                            <Button color="primary">Consultas</Button>{' '}
                        </Col>
                        <TableContainer component={Paper}>
                            <Table className={classes.table} aria-label="customized table">
                                <TableHead>
                                    <TableRow>
                                        <StyledTableCell>Dessert (100g serving)</StyledTableCell>
                                        <StyledTableCell align="right">Calories</StyledTableCell>
                                        <StyledTableCell align="right">Fat&nbsp;(g)</StyledTableCell>
                                        <StyledTableCell align="right">Carbs&nbsp;(g)</StyledTableCell>
                                        <StyledTableCell align="right">Protein&nbsp;(g)</StyledTableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody></TableBody>
                            </Table>
                        </TableContainer>
                    </Row>
                </Form>
            </Container>
        </div>
    );
}
export default checkpromo;
